// Some useful helper functions
// Each element in the returned array will be an object matching a row in the database

// Returns an array of all rooms
function getAllRooms() {
    return roomsDB().get();
}

// Returns an array of all singles
function getAllSingles() {
    return roomsDB({'numOccupants': 1}).get();
}

// Returns an array of all doubles
function getAllDoubles() {
    return roomsDB({'numOccupants': 2}).get();
}

// Returns an array of all triples
function getAllTriples() {
    return roomsDB({'numOccupants': 3}).get();
}

// Returns an array of all quads
function getAllQuads() {
    return roomsDB({'numOccupants': 4}).get();
}

// Returns an array of all empty rooms
function getAllUnoccupiedRooms() {
    return roomsDB({'occupied': false}).get();

}

// Returns all the rooms in a specific dorm
function getRoomsInDorm(dorm) {
    var generalDormString = dorm+'*';
    var dormRegExp = new RegExp(generalDormString, 'i');
    return roomsDB({'id': {regex: dormRegExp}}).get();
}

// Returns an array of all the empty rooms in a given location of a certain type
// Takes as input a location string which is either a dorm name or "all"
// and a type string which is either "single", "double", "triple", or "quad"
function getUnoccupiedRoomsByLocationAndType(location, type) {
    if (location == 'all') {
        location = '';
    }
    generalTypeString = location+'*';
    var numOccupants = 1;
    if (type == 'double') {
        numOccupants = 2;
    } else if (type == 'triple') {
        numOccupants = 3;
    } else if (type == 'quad') {
        numOccupants = 4;
    }
    var locRegEx = new RegExp(generalTypeString, 'i');
    return roomsDB({'id': {regex: locRegEx}, 'numOccupants': numOccupants, 'occupied': false}).get();
}

// Returns all empty rooms of a certian type
function getUnoccupiedRoomsByType(type) {
    var numOccupants = 1;
    if (type == 'double') {
        numOccupants = 2;
    } else if (type == 'triple') {
        numOccupants = 3;
    } else if (type == 'quad') {
        numOccupants = 4;
    }

    return roomsDB({'numOccupants': numOccupants, 'occupied': false}).get();
}

// Returns an array of all rooms of a type in a location
function getAllRoomsByLocationAndType(location, type) {
    if (location == 'all') {
        location = '';
    }
    generalTypeString = location+'*';
    var numOccupants = 1;
    if (type == 'double') {
        numOccupants = 2;
    } else if (type == 'triple') {
        numOccupants = 3;
    } else if (type == 'quad') {
        numOccupants = 4;
    }
    var locRegEx = new RegExp(generalTypeString, 'i');
    return roomsDB({'id': {regex: locRegEx}, 'numOccupants': numOccupants}).get();
}


